import React from "react";
import mainBackground from "./mainImages/japanRoad.png";
import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Jack Painter</h1>
        <img
          className="background"
          src={mainBackground}
          alt="Main Background"
        />
        <h2>Full-Stack Developer (London)</h2>
      </header>
    </div>
  );
}

export default App;
